// Importa createTheme e imposta 'dark' come valore predefinito
import { createTheme } from '@mui/material/styles';

const theme = createTheme({
  palette: {
    primary: {
      main: '#1976d2',
    },
    secondary: {
      main: '#f50057',
    },
  },
  // Aggiungi la proprietà 'dark' e imposta il valore booleano in base alla modalità desiderata
  // In questo esempio, l'ho impostato su 'true' per attivare la modalità scura
  dark: true,
});

// Assicurati che theme.vars.palette e ownerState.color siano definiti prima di accedere alla proprietà 'dark'
// Supponiamo che 'ownerState' sia un oggetto con proprietà 'color'
const backgroundColor = theme?.vars?.palette?.[ownerState?.color]?.dark || theme?.palette?.[ownerState?.color]?.dark || '';

export default theme;
